    false,nt"url": null,nt"notes": "This Land Protection Plan for Sangre de
    Cristo Conservation Area provides a description of the project, a description of
    the area and its resources, threats to the resources, and project implementation.
    The purpose of the SCCA is to protect the high-elevation wildlife habitats of the
    Sangre de Cristo Mountains and the uplands of the southeastern San Luis Valley,
    with an emphasis on migratory birds and imperiled species. Acquisitions within,
    and administration of, the SCCA will focus on promoting the adaptive capacity and
    resilience of these ecosystems by ensuring connectivity between existing protected
    areas and by protecting wildlife movement corridors, particularly riparian areas.",nt"license_title":
